        last: ''
      },
      username: '',
      password: '',
      email: '',
      location: '',
      phone: ''
    }
    console.log(this.state);
  }

  componentDidMount(){
    this.getChamp()
  }
  getUser() {
    fetch('http://ddragon.leagueoflegends.com/cdn/10.5.1/data/en_US/champion.json').then(response => response.json()).then(data => {
console.log(data);
    })
  }
  render (){
    return(<div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>)
  };
}

export default App;
